import React from "react";
// import { Link } from "react-router-dom";

export function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}

export function Mac() {
  return (
    <div>
      <h2>Mac</h2>
      <a href="#">MacBook Air</a>
      <a href="#">MacBook Pro</a>
      <a href="#">iMac</a>
      <a href="#">iMac Pro</a>
      Mac Pro New Mac mini CompareMac models Pro Display XDR New Accessoriesfor
      Mac Catalina
    </div>
  );
}

export function IPad() {
  return (
    <div>
      <h2>IPad</h2>
      <p>Look at all these ipads</p>
      <p>Look at all these ipads</p>
      <p>Look at all these ipads</p>
      <p>Look at all these ipads</p>
      <p>Look at all these ipads</p>
      <p>Look at all these ipads</p>
    </div>
  );
}

export function IPhone() {
  return (
    <div>
      <h2>iPhone</h2>
    </div>
  );
}

export function Watch() {
  return (
    <div>
      <h2>Watch</h2>
    </div>
  );
}

export function Television() {
  return (
    <div>
      <h2>Television</h2>
    </div>
  );
}

export function Music() {
  return (
    <div>
      <h2>Music</h2>
    </div>
  );
}

export function Support() {
  return (
    <div>
      <h2>Support</h2>
    </div>
  );
}
